import styled from "styled-components";
import { ModalHeader } from "reactstrap";

export const ProjectContainer = styled.div`
  background: #444649;
  padding: 100px 0;
  font-family: "Arvo", serif;
`;

export const ContentWrapper = styled.div`
  max-width: 1400px;
  margin: 0 auto;
`;
